import { Redirect } from 'react-router-dom';
import axiosBaseURL from '../axios.js'


export default class Logout extends Component {
   constructor(props) {
      super(props);
      this.state = {
         error: false,
         redirect: "/login"
      };
   }

   render(){
		if(this.state.error){
			return(<div classNameName="m-5"><h3>There was an error</h3></div>)
		}
	   // http call to /api/logout
      axiosBaseURL.get('/logout')
      .then((result) => {

      })
      .catch((error) => {
         this.setState({error:true})
         if(error.response){
            this.setState({error_response: error.response.status});
            if(error.response.data === "not authorized"){ this.setState({redirect: "/login"}) }
            else if (error.response.data){console.log(error.response.data)}
         }
      })
		return(   
         // redirect to /
         <Redirect to={this.state.redirect} />
      )
	}
}
